	componentDidMount() {
		//fetch gallery images
		fetch('https://api.instagram.com/v1/users/bonvivantcollection/media/recent?callback=&client_id=34a0fa1c1e884c3c9ea940f1a923488a')
		.then(res => res.json())
		.then(data => console.log(data))
	}

	render() {
